import React from 'react';
import './index.css';

export default function Nav(props) {
    let url="";
    return (
        <div className="NavBar col-lg-2 text-lg-end pe-lg-4 mb-4">
            <a href={url} className="navItem">home</a>
            <a href={url} className="navItem">about</a>
            <a href={url} className="navItem">projects</a>
            <a href={url} className="navItem">resume</a>
        </div>
    );
}
